package com.runoob;

import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

import javax.imageio.ImageIO;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.IOException;

/**
 * 图片二进制转换
 * @author zhangbocheng
 * @version 1.0
 * @date 2019/3/20 15:33
 */
public class BinaryToImage {
    static BASE64Encoder encoder = new sun.misc.BASE64Encoder();
    static BASE64Decoder decoder = new sun.misc.BASE64Decoder();

    public static void main(String[] args) {
        // System.out.println(getImageBinary(""));
        // python
        // String bs1 = "data:image/jpg;base64,";
        // http://tool.chinaz.com/tools/imgtobase/
        // String bs2 = "data:image/jpg;base64,";
        // System.out.println(bs1.equals(bs2));
        // FIXME: 示例图片无法还原.
        // base64StringToImage("test_pic.jpg", bs2);
    }

    public static String getImageBinary(String imagePath) {
        File f = new File(imagePath);
        BufferedImage bi;
        try {
            bi = ImageIO.read(f);
            ByteArrayOutputStream bo = new ByteArrayOutputStream();
            ImageIO.write(bi, "jpg", bo);
            byte[] bytes = bo.toByteArray();
            return encoder.encodeBuffer(bytes).trim();
        } catch (IOException e) {
            e.printStackTrace();
            return null;
        }
    }

    public static void base64StringToImage(String savePath, String base64String) {
        try {
            byte[] bytes = decoder.decodeBuffer(base64String);
            ByteArrayInputStream bai = new ByteArrayInputStream(bytes);
            BufferedImage bi =ImageIO.read(bai);

            File file = new File(savePath);
            ImageIO.write(bi, "jpg", file);
        } catch (IOException e) {
            e.printStackTrace();
        }
    }
}
